INSERT INTO main_app_client(status, name, position, image, email, phone, resume, linkedin, notes, created_at, user_id)
 VALUES
 ('INITIAL CONTACT', 'Daisy Adair', 'Marketing Coordinator', 'https://static.bangkokpost.com/media/content/20200619/c1_1937552_200619122619.jpg', 'daisy@gmail.com', '912-292-3062', 'https://docs.google.com/document/d/1J1VYv45XWA9j9oEoeHSBLNt0ImlTdosT-WSe5rEwA3s/edit?usp=sharing', 'https://www.linkedin.com/', 'Remote work preferable, PTO and health benefits are highly expected. Flexibility is top of wish list, and it seems they are not prepared to compromise. The client wants to find a purpose in life, and is seeking out employers that share their values.', '2022-06-06 18:57:42.517206-06', 1);
INSERT INTO main_app_client(status, name, position, image, email, phone, resume, linkedin, notes, created_at, user_id)
 VALUES
 ('PHONE SCREEN', 'Sally Albright', 'Medical Assistant', 'https://i.insider.com/61f14a0ce996470011907119?width=600&format=jpeg&auto=webp','albright@gmail.com', '856-389-4614', 'https://docs.google.com/document/d/1bOOsW4bwnEGTB0OQWcOfYk2TkRDbX1And4jTb-NBo9w/edit?usp=sharing', 'https://www.linkedin.com/', 'Great energy and extremely motivated. Prefers West Coast hospitals. Job seeker desires to see clear paths for career growth within an organization. This includes opportunities to gain the knowledge, skills, and experience needed for promotions. On-the-job training, company-sponsored professional development, and other opportunities for career growth are highly expected as well.', '2022-06-06 18:57:42.517206-06', 1);
INSERT INTO main_app_client(status, name, position, image, email, phone, resume, linkedin, notes, created_at, user_id)
 VALUES
 ('INTERVIEW', 'George Bailey', 'Web Designer', 'https://burst.shopifycdn.com/photos/professional-man-portrait.jpg?width=500&format=pjpg&exif=1&iptc=1', 'gbailey@comcast.com', '415-730-0257', ' https://docs.google.com/document/d/1QuK9vYKm6TU1Xu7ztM_2GD_6n4X4C58dtF9NN1l44K4/edit?usp=sharing', 'https://www.linkedin.com/', 'Great technical and soft skills. Prefers remote work. Perks such as flexible schedules, remote work options, and paid leave is beneficial as well are highly expected. The client believes, the more flexibility offered, the easier it is to integrate personal and professional responsibilities.', '2022-06-06 18:57:42.517206-06', 1);
INSERT INTO main_app_client(status, name, position, image, email, phone, resume, linkedin, notes, created_at, user_id)
 VALUES
 ('IN CONSIDERATION', 'Travis Bickle', 'Nursing Assistant', 'https://images.unsplash.com/photo-1564564321837-a57b7070ac4f?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Nnx8bWFufGVufDB8fDB8fA%3D%3D&w=1000&q=80', 'tbickle@yahoo.com', '810-346-0115', 'https://docs.google.com/document/d/1PKTSHcSfI5-eMu9_POQmecD91N8CJWSpWkvfDZQjSNc/edit?usp=sharing', 'https://www.linkedin.com/', 'Client expects higher income than they did before. Because their knowledge, skills, and experience can add increased value to an organization, the client wants to be compensated accordingly. They also desire attractive benefits such as health insurance, retirement plans with employer matches, and paid time off.', '2022-06-06 18:57:42.517206-06', 1);
INSERT INTO main_app_client(status, name, position, image, email, phone, resume, linkedin, notes, created_at, user_id)
 VALUES
 ('HIRED', 'Martin Blank', 'Project Manager', 'https://media.istockphoto.com/photos/young-smiling-handsome-man-in-casual-clothes-posing-isolated-on-blue-picture-id1249420269?k=20&m=1249420269&s=612x612&w=0&h=taSQreK8i8J_nt-NQR0SBGVhXXtNWAtJuXiBnHBNW0g=', 'martin_blank@gmail.com', '712-667-3756', 'https://docs.google.com/document/d/17S1YiG0bcLyVrqUrOfRSpV3F_NIH1HUWjYmQTkcsnXs/edit?usp=sharing', 'https://www.linkedin.com/', 'Amazing communication skills and work-related experience. The client wants to know mission, vision, and values of the company that impact the work environment. For instance, client would like to see some photos and videos of employees at work and company events, as well as a description of  a typical day in the role may be.', '2022-06-06 18:57:42.517206-06', 1);
INSERT INTO main_app_client(status, name, position, image, email, phone, resume, linkedin, notes, created_at, user_id)
 VALUES
 ('DECLINED', 'Katie Brown', 'Librarian', 'https://i.insider.com/5cb8b133b8342c1b45130629?width=700', 'katieb@gmail.com', '603-232-9171', 'https://docs.google.com/document/d/1jwhNM0jo1aAA8TMqFleD2b1V9aR9dN5HslYm1sXkyUs/edit?usp=sharing', 'https://www.linkedin.com/', 'Great potential, extremely motivated person. The client would like to learn more about the people who are working at the company they are applying for to get the information about the kinds of people the company employs, and it might help the client to network with current or former workers.', '2022-06-06 18:57:42.517206-06', 1);
INSERT INTO main_app_client(status, name, position, image, email, phone, resume, linkedin, notes, created_at, user_id)
 VALUES
 ('WITHDREW', 'Rosco P. Coltrane', 'Account Executive', 'https://cdn2.psychologytoday.com/assets/styles/manual_crop_1_91_1_1528x800/public/field_blog_entry_images/2017-09/shutterstock_243101992.jpg?itok=nKwkA392', 'roscop@gmail.com', '469-552-1975', 'https://docs.google.com/document/d/1meAOERJMDGbAKfuAAQeyafnB5ujMEejt1qE-nti61iI/edit?usp=sharing', 'https://www.linkedin.com/', 'Located in MA and looking for a job in New England. Client wants to know who the leaders of the company are and what management philosophies they follow. The client believes that different approaches work for different people, so it is important that they feel that it suits them as a professional.', '2022-06-06 18:57:42.517206-06', 1);
 INSERT INTO main_app_client(status, name, position, image, email, phone, resume, linkedin, notes, created_at, user_id)
 VALUES
 ('INITIAL CONTACT', 'Emily Baldwin','Marketing Consultant', 'https://images.unsplash.com/photo-1438761681033-6461ffad8d80?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MXx8cmFuZG9tJTIwcGVvcGxlfGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=500&q=60', 'emilyb@gmail.com', '202-574-3338', 'https://docs.google.com/document/d/1PNzYOnHtXFZqGHBoioUjwx387qEtU6nFl66zsp5KuBc/edit?usp=sharing', 'https://www.linkedin.com/', 'Looking for an  in-person job and friendly environment is a high priority. Culture is more than just a buzzword for the client - they would like to know if they will be a good fit with the company and its values. Client would to get new information as soon as possible', '2022-06-08 18:57:42.517206-06', 1);
