 VALUES
 ('PHONE SCREEN', 'Rick Blaine', 'Quality Control Coordinator', 'https://images.unsplash.com/photo-1530268729831-4b0b9e170218?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8OHx8cmFuZG9tJTIwcGVvcGxlfGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=500&q=60', 'rickb@','212-200-7300', 'https://docs.google.com/document/d/1PNzYOnHtXFZqGHBoioUjwx387qEtU6nFl66zsp5KuBc/edit?usp=sharing', 'https://www.linkedin.com/', 'Focus on in-person jobs and 10 miles range NYC. Looking for an opportunity to grow at a new place', '2022-06-08 18:57:42.517206-06', 1);
