 ('INTERVIEW', 'Frank Booth', 'Account Collector', 'https://images.unsplash.com/photo-1487222477894-8943e31ef7b2?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MjB8fHJhbmRvbSUyMHBlb3BsZXxlbnwwfHwwfHw%3D&auto=format&fit=crop&w=500&q=60', 'frank_booth@att.net', '201-200-8863', 'https://docs.google.com/document/d/1PNzYOnHtXFZqGHBoioUjwx387qEtU6nFl66zsp5KuBc/edit?usp=sharing', 'https://www.linkedin.com/', '', '2022-06-08 18:57:42.517206-06', 1);
 INSERT INTO main_app_client(status, name, position, image, email, phone, resume, linkedin, notes, created_at, user_id)
 VALUES
 ('DECLINED', 'Sarah Connor', 'Data Entry', 'https://images.unsplash.com/photo-1519419691348-3b3433c4c20e?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MjV8fHJhbmRvbSUyMHBlb3BsZXxlbnwwfHwwfHw%3D&auto=format&fit=crop&w=500&q=60', 'sarahcnr@comcast.net', '201-207-9733', 'https://docs.google.com/document/d/1PNzYOnHtXFZqGHBoioUjwx387qEtU6nFl66zsp5KuBc/edit?usp=sharing', 'https://www.linkedin.com/', 'Reputation of the company is extremely important for the client, as well as its stabilitu and progress in its niche. If she is going to commit to working for the comapny, she wants to know their business is going to be around for a while.', '2022-06-08 18:57:42.517206-06', 1);
 INSERT INTO main_app_client(status, name, position, image, email, phone, resume, linkedin, notes, created_at, user_id)
 VALUES
 ('HIRED', 'Daisy Duck', 'Technical Specialist', 'https://images.unsplash.com/photo-1491349174775-aaafddd81942?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8NzJ8fHJhbmRvbSUyMHBlb3BsZXxlbnwwfHwwfHw%3D&auto=format&fit=crop&w=500&q=60', 'ddaisy@verizon.net', '206-215-3756', 'https://docs.google.com/document/d/1PNzYOnHtXFZqGHBoioUjwx387qEtU6nFl66zsp5KuBc/edit?usp=sharing', 'https://www.linkedin.com/', 'Client would like to know how much they are going to make and what kinds of perks they will receive if they work for the company from the very beginning and openly.', '2022-06-08 18:57:42.517206-06', 1);
 INSERT INTO main_app_client(status, name, position, image, email, phone, resume, linkedin, notes, created_at, user_id)
 VALUES
 ('INTERVIEW', 'Becky Howard', 'Application Developer', 'https://images.unsplash.com/photo-1439778615639-28529f7628bc?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mzd8fHJhbmRvbSUyMHBlb3BsZXxlbnwwfHwwfHw%3D&auto=format&fit=crop&w=500&q=60', 'beckyh@gmail.com', '203-207-8376', 'https://docs.google.com/document/d/1PNzYOnHtXFZqGHBoioUjwx387qEtU6nFl66zsp5KuBc/edit?usp=sharing', 'https://www.linkedin.com/', 'Lifestyle: schedule flexibility, travel requirements, environmental and social impact. Flexibility is an important part of this equation to, and this client, especially, will expect the company to provide flex options if they are going to bring their talents to the organization.', '2022-06-08 18:57:42.517206-06', 1);
 INSERT INTO main_app_client(status, name, position, image, email, phone, resume, linkedin, notes, created_at, user_id)
 VALUES
 ('PHONE SCREEN', 'Brittany Hunt', 'Sales Manager', 'https://images.unsplash.com/photo-1502767882403-636aee14f873?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8NDB8fHJhbmRvbSUyMHBlb3BsZXxlbnwwfHwwfHw%3D&auto=format&fit=crop&w=500&q=60', 'bhunt@msn.com', '203-215-3711', 'https://docs.google.com/document/d/1PNzYOnHtXFZqGHBoioUjwx387qEtU6nFl66zsp5KuBc/edit?usp=sharing', 'https://www.linkedin.com/', 'Client does not want to feel like they are going to be stuck forever in the role for which they are applying. The client would like to know whether the company promote from within, and and would like to learn about the career development plans of tthe company they are apllying.', '2022-06-08 18:57:42.517206-06', 1);